var data = [
    {
      id: 0,
      name: "Iphone 12",
      price: 15000000,
      status: true,
    },
    {
      id: 1,
      name: "Iphone 12 Pro",
      price: 23000000,
      status: false,
    },
    {
      id: 2,
      name: "Iphone 12 Pro Max",
      price: 27000000,
      status: true,
    }
];

var initialState = data ? data : [];

const myReducer = (State = initialState, action) => {
    switch(action.type){
        default: 
            return [...State];
    }
}

export default myReducer;
